package swa.manage.entity;import java.io.Serializable;import java.util.Date;/** * RoomConfig:配置表 * Created by jinyan.cao on 2017-07-03 17:47:53 */public class RoomConfig implements Serializable {    private static final long serialVersionUID = -7955588233027078531L;    /**     * 自增主键     */    private Long id;    /**     * 编码:layer-pid     */    private String encode;    /**     * 所属层级     */    private Integer layer;    /**     * 层级编码:0,1,2     */    private Integer pid;    /**     * 展示名称     */    private String roomName;    /**     * 所在上一层级编码     */    private Integer pPid;    /**     * 是否可用：0-不可用，1-可用     */    private Integer isvalid;    /**     * 创建时间     */    private Date createTime;    /**     * 更新时间     */    private Date updateTime;    public Long getId() {        return this.id;    }    public void setId(Long id) {        this.id = id;    }    public String getEncode() {        return this.encode;    }    public void setEncode(String encode) {        this.encode = encode;    }    public Integer getLayer() {        return this.layer;    }    public void setLayer(Integer layer) {        this.layer = layer;    }    public Integer getPid() {        return this.pid;    }    public void setPid(Integer pid) {        this.pid = pid;    }    public String getRoomName() {        return roomName;    }    public void setRoomName(String roomName) {        this.roomName = roomName;    }    public Integer getpPid() {        return pPid;    }    public void setpPid(Integer pPid) {        this.pPid = pPid;    }    public Integer getPPid() {        return this.pPid;    }    public void setPPid(Integer pPid) {        this.pPid = pPid;    }    public Integer getIsvalid() {        return this.isvalid;    }    public void setIsvalid(Integer isvalid) {        this.isvalid = isvalid;    }    public Date getCreateTime() {        return createTime;    }    public void setCreateTime(Date createTime) {        this.createTime = createTime;    }    public Date getUpdateTime() {        return updateTime;    }    public void setUpdateTime(Date updateTime) {        this.updateTime = updateTime;    }    @Override    public String toString() {        return "RoomConfig{" +                "id=" + id +                ", encode='" + encode + '\'' +                ", layer=" + layer +                ", pid=" + pid +                ", roomName='" + roomName + '\'' +                ", pPid=" + pPid +                ", isvalid=" + isvalid +                ", createTime=" + createTime +                ", updateTime=" + updateTime +                '}';    }}